import React from 'react'

const UnitsList = (props) => {
  return (
    <ul>
      {props.units.map((unit) => (
        <li  key={unit.id}> name={unit.name}
        age={unit.age}
        costs={unit.costs}</li> 
      ))}
      </ul>
  );
};

export default UnitsList;
